import "./App.css";
import ProjectsPage from "./projects/ProjectsPage";

// Greeter function component
function Greeter(props: any) {
	// Destructuring Props
	const { first, last } = props;
	return (
		<h1>
			Hello, {first} {last}
		</h1>
	);
}

